#include <iostream>
#include <vector>

using namespace std;

class Solution {
    public:
        int numberOfAlternatingGroups(vector<int>& colors, int k) {
            int count = 0;
            colors.insert(colors.end(), colors.begin(), colors.begin() + (k-1));
            int left = 0;
            
            for(int right = 1; right < colors.size(); right++) {
                if(colors[right] == colors[right-1]) left = right;
                if(right-left+1 >= k) count++;
            }

            return count;
        }
    };

